<script>
    var atualizarPerfil = function () {
        var url = '/Home/AtualizarPerfil';
        var form = $('#formAtualizarPerfil');
        var admin = {
            Id: form.find('#Id').val(),
            DtCriacao: form.find('#DtCriaca");
