            Senha: form.find('#Senha').val(),
            ConfirmacaoSenha: form.find('#ConfirmacaoSenha').val()
        };
        $.ajax({
            url: url,
            type: 'POST',
            data: { admin: admin }
        }).done(function (data) {
            if (data.success) {
                Swal.fire({
                    title: 'Sucesso!',
                    html: data.message,
                    icon: 'success'
                }).then(function () {
                    window.location.reload();
                    window.location = '/Home/Perfil';
                });
